import React from "react";
import {useSelector} from "react-redux";

import Post from "../components/Post";

const PostList = (props) => {
    const post_list = useSelector((state) => state.post.list);
    return (
        <React.Fragment>
            <Post/>
        </React.Fragment>
    )
}

export default PostList;
